import { Component } from 'react';
import './card-list.style.css';
import Card from '../card/card';

const CardList = () => {
  return (
    <div className='card-list'>
      {nfts.map((nft) => {
        return <Card nft={nft} />;
      })}
    </div>
  );
};

const { nfts } = this.props;

export default CardList;
